import axios from 'axios';

const USER_API_BASE_URL = "http://localhost:8080/api/user";

class UserService {
    getUser(user) {
        return axios.get(USER_API_BASE_URL, {
            "username": "tony",
            "password": "pass"
        });
    }
}

export default new UserService()
